  `col9` varchar(200) collate utf8_unicode_ci default NULL,
  `col10` varchar(200) collate utf8_unicode_ci default NULL,
  `col11` varchar(200) collate utf8_unicode_ci default NULL,
  `col12` varchar(200) collate utf8_unicode_ci default NULL,
  `col13` varchar(200) collate utf8_unicode_ci default NULL,
  `col14` varchar(200) collate utf8_unicode_ci default NULL,
