/* Procedure structure for procedure `Analysis` */

/*!50003 DROP PROCEDURE IF EXISTS  `Analysis` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `Analysis`()
BEGIN
	DECLARE batch VARCHAR(50) DEFAULT '';	
	
	set batch= UUID();
	
	# -----------------------------------------------------------
	# 1、对比城镇居民医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT 1,IdNumber,ids,names,now(),batch,dataCount
	FROM (SELECT
		IdNumber,
		COUNT(0)    dataCount,
		GROUP_CONCAT(ID)    ids,
		GROUP_CONCAT(name)  names
	      FROM czjmyb
	      GROUP BY IdNumber) t
	WHERE t.dataCount > 1;
	
	
	# -----------------------------------------------------------
	# 2、对比城镇职工医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT 2,IdNumber,ids,NAMES,NOW(),batch,dataCount
	FROM (SELECT
		IdNumber,
		COUNT(0)    dataCount,
		GROUP_CONCAT(ID)    ids,
		GROUP_CONCAT(NAME)  NAMES
	      FROM czzzyb
	      GROUP BY IdNumber) t
	WHERE t.dataCount > 1;
	
	# -----------------------------------------------------------
	# 3、对比新农合医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT 3,IdNumber,ids,NAMES,NOW(),batch,dataCount
	FROM (SELECT
		IdNumber,
		COUNT(0)    dataCount,
		GROUP_CONCAT(ID)    ids,
		GROUP_CONCAT(NAME)  NAMES
	      FROM xnhyb
	      GROUP BY IdNumber) t
	WHERE t.dataCount > 1;	
	
	# -----------------------------------------------------------
	# 4、对比城镇居民医保 + 城镇职工医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT
	  4,
	  czjmyb.IdNumber,
	  GROUP_CONCAT( CONCAT('1:',czjmyb.ID,'|2:',czzzyb.ID)),
	  GROUP_CONCAT( CONCAT('1:',czjmyb.Name,'|2:',czzzyb.Name)),
	  NOW(),
	  batch,
	  2
	FROM czjmyb
	  INNER JOIN czzzyb
	    ON czjmyb.IdNumber = czzzyb.IdNumber
	GROUP BY czjmyb.IdNumber;
	
	# -----------------------------------------------------------
	# 5、对比城镇居民医保 + 新农合医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT
	  5,
	  czjmyb.IdNumber,
	  GROUP_CONCAT( CONCAT('1:',czjmyb.ID,'|3:',xnhyb.ID)),
	  GROUP_CONCAT( CONCAT('1:',czjmyb.Name,'|3:',xnhyb.Name)),
	  NOW(),
	  batch,
	  2
	FROM czjmyb
	  INNER JOIN xnhyb
	    ON czjmyb.IdNumber = xnhyb.IdNumber
	GROUP BY czjmyb.IdNumber;
	
	# -----------------------------------------------------------
	# 6、对比城镇职工医保 + 新农合医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT
	  6,
	  czzzyb.IdNumber,
	  GROUP_CONCAT( CONCAT('2:',czzzyb.ID,'|3:',xnhyb.ID)),
	  GROUP_CONCAT( CONCAT('2:',czzzyb.Name,'|3:',xnhyb.Name)),
	  NOW(),
	  batch,
	  2
	FROM czzzyb
	  INNER JOIN xnhyb
	    ON czzzyb.IdNumber = xnhyb.IdNumber
	GROUP BY czzzyb.IdNumber;
	
	
	# -----------------------------------------------------------
	# 7、对比城镇居民医保 + 城镇职工医保 + 新农合医保身份证号重复的数据
	INSERT INTO analysisresult 
		(
			AnalysisType,  -- 类型
			IdNumber, 
			Ids, 
			NAMES, 
			DateAdd, 
			Batch,
			DataCount
		)	
	SELECT
	  7,
	  czzzyb.IdNumber,
	  GROUP_CONCAT( CONCAT('1:',czjmyb.ID,'|2:',czzzyb.ID,'|3:',xnhyb.ID)),
	  GROUP_CONCAT( CONCAT('1:',czjmyb.Name,'|2:',czzzyb.Name,'|3:',xnhyb.Name)),
	  NOW(),
	  batch,
	  2
	FROM czzzyb
	  INNER JOIN xnhyb
	    ON czzzyb.IdNumber = xnhyb.IdNumber
	    INNER JOIN czjmyb ON xnhyb.IdNumber=czjmyb.IdNumber
	GROUP BY czzzyb.IdNumber;
	
	# -----------------------------------------------------------
	# 删除老批次数据
	delete from AnalysisResult where AnalysisResult.Batch <> batch;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `DeleteData` */

/*!50003 DROP PROCEDURE IF EXISTS  `DeleteData` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `DeleteData`()
BEGIN
		delete from czjmyb;
		delete from czzzyb;
		delete from xnhyb;
    END */$$
DELIMITER ;

